function CountTime(n){this.millisec=n-new Date>0?n-new Date:0}CountTime.prototype={day:function(){return parseInt(this.millisec/864e5)},hour:function(){return parseInt(this.millisec/36e5%24)},minute:function(){return parseInt(this.millisec/6e4%60)},second:function(){return parseInt(this.millisec/1e3%60)},fomate:function(n){return n<10&&(n="0"+n),n}};